const GetData = ({givenText,display}) => {

    const options = {
        method: 'GET',
        headers: {
            'X-RapidAPI-Key': '49eb6ba052msh1bc72a8983a318cp14adf1jsn06a9b26bddc8',
            'X-RapidAPI-Host': 'moviesdatabase.p.rapidapi.com'
        }
    };
    
    fetch(`https://moviesdatabase.p.rapidapi.com/titles/search/title/+${JSON.stringify(givenText)}?exact=false`, options)
        .then(response => response.json())
        .then(response => display({response}))
        .catch(err => console.error(err))

  return 
}

export default GetData
